  return (
    <Grid container spacing={1}>
    <Grid container item xs={12} spacing={3}>
      <FormRow />
    </Grid>
    <Grid container item xs={12} spacing={3}>
      <FormRow />
    </Grid>
    <Grid container item xs={12} spacing={3}>
      <FormRow />
    </Grid>
  </Grid>
  );
}

export default SvgCard;
